    const expenseAmount = 2389.3
  return (
    <div className="expense-item">
      <div>13-09-2023</div>
      <div className="expense-item__description">
        <h2>car insurance</h2>
        <div className="expense-item__price">Rs.23983</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
